import './App.css';
import React from 'react';
import { BrowserRouter as Router, Switch, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <Router>
      <Navbar />
        <Switch>
          <Route path='/'/>
        </Switch>
      </Router>
      <h1>Hello</h1>
    </div>
  );
}

export default App;
